import React from 'react';
import Head from 'next/head'
import Header from './Header';
import Footer from './Footer';
import DarkModeSwtich from './smallComponents/DarkModeSwitch';

export default function Layout (Page) {

    return (props) => {
        return ( 
            <>
                <DarkModeSwtich/>
                <Header/>
                <main className={"main"}>
                        <Page {...props}/>
                </main>
                <Footer/>
            </>
        )
    }
}

